import Search from "./Search";
import SearchResult from "./SearchResult";

function Edit() {
  const [searchResults, setSearchResults] = useState({});
  return (
    <div>
      <Search setSearchResults={setSearchResults} />
      <SearchResult searchResults={searchResults} />
    </div>
  );
}

export default Edit;
